Object.Field:
BEGIN
DBMS_STATS.GATHER_TABLE_STATS (
    ownname =>	'<?=snpRef.getInfo("DEST_WORK_SCHEMA") ?>',
    tabname =>	'<?=snpRef.getObjectName("L", "%COL_PRF0CRM_EVENTS", "W").replaceAll(odiRef.getInfo( "DEST_WORK_SCHEMA" )+".","")?>',
    estimate_percent =>	DBMS_STATS.AUTO_SAMPLE_SIZE
);
END;

declare
  p_sess_no number := <?=snpRef.getSession("SESS_NO") ?>;
  p_scen_name varchar2(250 char) := '<?=snpRef.getSession("SCEN_NAME") ?>';
  p_sess_name varchar2(250 char) := '<?=snpRef.getSession("SESS_NAME") ?>';
  p_owner varchar2(30 char) := '<?=snpRef.getInfo("DEST_SCHEMA") ?>';
  p_table_name varchar2(30 char) := 'CRM_EVENTS';
  v_cnt number;
  v_file_id number;
begin
 select count(*)
 into v_cnt
 from <@=lSchema@>.<@=gTab@>
 where SESS_NO = <?=snpRef.getSession("SESS_NO") ?>;
 if v_cnt > 0 then 
    select max(nvl(file_id, -1))
    into v_file_id
    from <@=lSchema@>.<@=gTab@>;
    ETL.SET_FILE_STATUS(p_file_id => v_file_id, p_status_cd => '-20');
    execute immediate 'truncate table <?=snpRef.getObjectName("L", "CRM_EVENTS", "STG_XML_CRM", "", "D") ?> ';
    --raise_application_error(-20001, 'STG loading Error ');
else 
for x in (
select file_id
from <?=snpRef.getSchemaName("STG_XML_CRM", "D") ?>.<?=snpRef.getObjectShortName("L", "%COL_PRF0CRM_EVENTS", "W") ?> where rownum<=1
)
loop
  insert into ETL.CTL_INPUT_FILES_LOG values(x.file_id,2,sysdate);
  update ETL.CTL_INPUT_FILES_LOADING set status_cd=p_owner, load_dt=sysdate where file_id=x.file_id;
--  update ETL.CTL_INPUT_FILES set status_cd = 2 where file_id = x.file_id;
end loop;
 end if;
end;

begin
    dbms_stats.gather_table_stats(
	ownname => '<?=snpRef.getInfo("DEST_SCHEMA") ?>',
	tabname => '<?=snpRef.getObjectName("L", "CRM_EVENTS", "STG_XML_CRM", "", "D").replaceAll( "("+(char)92+"Q" + odiRef.getInfo( "DEST_SCHEMA" )+ (char)92+"E|" + (char)92 + "Q" + odiRef.getInfo( "DEST_WORK_SCHEMA" )+ (char)92 + "E).","")?>',
	estimate_percent => dbms_stats.auto_sample_size
    );
end;
